const mask = .004 // solder mask size
const border = 0.05 // rendering border


/* -- DECLARE_PCB -- */
let board = new PCB();

let interior = new Turtle().rectangle(width, height).translate([x+width/2, y+height/2]);
board.addShape("interior", interior);


/* -- ADD_COMPONENTS -- */
let IC1 = board.add(ATtiny1614, {translate: [x+.63, y+.55], name: 'IC1\nt1614'});
let J1 = board.add(header_FTDI, {translate: [x+.23, IC1.posY], rotate: 180, name: 'J1\nFTDI'});
let IC2 = board.add(regulator_SOT23, {translate: [J1.posX, J1.padY("GND")-.13], rotate: -90, name: 'IC2\n3.3V'});
let C1 = board.add(C_1206, {translate: [IC2.posX+.15, IC2.posY], rotate: 90, name: 'C1\n1uF'});
let J2 = board.add(header_UPDI, {translate: [IC1.posX, y+.23], rotate: 90, name: 'J2\nUPDI'});
let J3 = board.add(header_MFRC522, {translate: [x+width-.23, IC1.posY-.1], name: 'J3\nMFRC522'});
let R1 = board.add(R_1206, {translate: [J3.posX-.14, J3.padY("CIPO")], rotate: 90, name: 'R1\n0'});


/* -- ADD_WIRES -- */
board.wire([IC1.pad("RB3"),
            [IC1.padX("RB3")-.14, IC1.padY("RB3")],
            [IC1.padX("RB3")-.14, J1.padY("RTS")+.06],
            [J1.posX-.1, J1.padY("RTS")+.06],
            [J1.posX-.1, J1.padY("Tx")],
            J1.pad("Tx")], w)

board.wire([IC1.pad("TB2"),
            [IC1.padX("TB2")-.17, IC1.padY("TB2")],
            [IC1.padX("TB2")-.17, J1.padY("Rx")],
            J1.pad("Rx")], w)

board.wire([IC2.pad("in"),
            [J1.posX-.1, IC2.padY("in")],
            [J1.posX-.1, J1.padY("VCC")],
            J1.pad("VCC")], w)

board.wire([IC2.pad("gnd"),
            J1.pad("GND")], w)

board.wire([C1.pad("1"),
            [IC2.posX, C1.padY("1")],
            IC2.pad("gnd")], w)

board.wire([C1.pad("2"),
            [IC2.padX("out"), C1.padY("2")],
            IC2.pad("out")], w)

board.wire([C1.pad("2"),
            [C1.padX("2"), IC1.padY("TB2")-.05],
            [IC1.posX-.03, IC1.padY("TB2")-.05],
            [IC1.posX-.03, IC1.padY("VCC")],
            IC1.pad("VCC")], w)

board.wire([IC1.pad("UPDI"),
            [IC1.posX+.03, IC1.padY("UPDI")],
            [IC1.posX+.03, J2.posY],
            J2.pad("UPDI")], w)

board.wire([IC1.pad("GND"),
            [IC1.posX, IC1.padY("GND")],
            [IC1.posX, J2.posY+.09],
            [J2.padX("GND"), J2.posY+.03],
            J2.pad("GND")], w)

board.wire([C1.pad("1"),
            [J2.padX("GND"), C1.padY("1")],
            J2.pad("GND")], w)

board.wire([IC1.pad("PA4"),
            [IC1.padX("PA4")-.08, IC1.padY("PA4")],
            [IC1.padX("PA4")-.08, J3.padY("SDA")],
            J3.pad("SDA")], w)

board.wire([IC1.pad("PA3"),
            [IC1.padX("PA3")+.11, IC1.padY("PA3")],
            [IC1.padX("PA3")+.11, J3.padY("SCK")],
            J3.pad("SCK")], w)

board.wire([J3.pad("GND"),
            [J3.posX-.13, J3.padY("GND")],
            [J3.posX-.13, C1.padY("1")],
            C1.pad("1")], w)

board.wire([J3.pad("RST"),
            [J3.posX+.1, J3.padY("RST")],
            [J3.posX+.1, J3.padY("SDA")+.06],
            [IC1.padX("PA5")-.11, J3.padY("SDA")+.06],
            [IC1.padX("PA5")-.11, IC1.padY("PA5")],
            IC1.pad("PA5")], w)

board.wire([C1.pad("2"),
            [C1.posX, IC1.padY("TB2")-.05],
            [IC1.padX("TB2")-.2, IC1.padY("TB2")-.05],
            [IC1.padX("TB2")-.2, J1.padY("VCC")+.05],
            [J1.posX-.13, J1.padY("VCC")+.05],
            [J1.posX-.13, C1.padY("1")-.07],
            [J3.posX-.1, C1.padY("1")-.07],
            [J3.posX-.1, J3.padY("33V")],
            J3.pad("33V")], w)

board.wire([IC1.pad("PA1"),
            [IC1.padX("PA1")+.08, IC1.padY("PA1")],
            [IC1.padX("PA1")+.08, R1.padY("1")],
            R1.pad("1")], w)

board.wire([R1.pad("2"),
            [R1.posX, J3.padY("COPI")],
            J3.pad("COPI")], w)

board.wire([IC1.pad("PA2"),
            [IC1.padX("PA2")+.11, IC1.padY("PA2")],
            [IC1.padX("PA2")+.11, J3.padY("CIPO")],
            J3.pad("CIPO")], w)


/* -- RENDER_PCB -- */
renderPCB({
  pcb: board,
  layerColors: {
    "interior": "#002d00ff",
    "B.Cu": "#ff4c007f",
    "F.Cu": "#ff8c00cc",
    "drill": "#ff3300e5",
    "padLabels": "#ffff99e5",
    "componentLabels": "#00e5e5e5",
  },
  limits: {
    x: [x-border, x+width+border],
    y: [y-border, y+height+border]
  },
  mm_per_unit: 25.4
})
